import { usePlayer } from "components/hooks";

export const Player = () => {
  const { movie } = usePlayer();

  return (
    <>
      <Banner image={"player"} />
      <Title>PLayer</Title>

      <iframe width="560" height="315" src={movie?.link} title={movie?.title} frameBorder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowFullScreen></iframe>
    </>
  );
};
